        title:"Package 1",
        image :"../../../public/assesst/ContactHeader.png",
    },
    {
        id:2,
        title:"Package 2",
        image :{img1},
       
    },
    {
        id:3,
        title:"Package 3",
        image :"../assesst/img3.jpg",
    },
    {
        id:1,
        title:"Package 1",
        image :"../../public/assesst/Logo.png",
    },
    {
        id:2,
        title:"Package 2",
        image :"../public/assesst/img2.jpg",
    },
    {
        id:3,
        title:"Package 3",
        image :"../assesst/img3.jpg",
    },
  
]

export default Data;
